import { Component } from 'react';

function DeleteDataset(props) {
    const {datasetOriginalJSON} = props.state;
    return (
        <div>
            <form>
                <h2>Do you want to Delete {datasetOriginalJSON.name}?</h2>
                <button>Yes</button>
                <button>No</button>
            </form>
        </div>
    )
}


export default DeleteDataset
